import React from 'react';
import ToDo from './ToDo';

export default function ToDoList({ todos = [], handleCheckboxChange, handleTodoClick, handleDeleteClick, handleEditClick, isDeleteMode, selectedTodoId, onDateChange, userId }) {
  return (
    <fieldset>
      <legend className="sr-only">Tasks</legend>
      <div className="space-y-1">
        {todos.map(todo => (
          <ToDo
            key={todo.taskId}
            todo={todo}
            handleCheckboxChange={() => handleCheckboxChange(todo.taskId)}
            handleTodoClick={() => handleTodoClick(todo.taskId)}
            handleDelete={() => handleDeleteClick(todo.taskId)}
            handleEditClick={() => handleEditClick(todo)}
            isSelected={todo.taskId === selectedTodoId}
            onDateChange={onDateChange}
            isDeleteMode={isDeleteMode}
            userId={userId}
          />
        ))}
      </div>
    </fieldset>
  );
}
